import React, { useEffect, useState } from 'react'
import '../Header/Header.css'
import WhiteLogo from '../Assets/white-logo.svg'
import { Link } from 'react-router-dom'

/**
* @author
* @function Header
**/

const Header = () => {
    const [changeTitle, setChangeTitle] = useState({
        title: 'Dashboard/Analytics'
    })

const handleSubmit = (title) =>{
switch (title) {
    case title === 'dash':
        setChangeTitle({title: 'Dashe'})
        break;

    default:
        break;
}
}



    return (
        <div className='header_container'>
            <div id='nav_container'>
                <div className='header_wrapper'>
                    <div className='header_info_container'>
                        <img src={WhiteLogo} alt='logo'></img>
                    </div>
                    <div className='header_info_container nav'>
                        <Link onClick={handleSubmit('dash')} className='nav_link' to='#'>Dashboard</Link>
                        <Link className='nav_link' to='#'>Lot Management</Link>
                        <Link className='nav_link' to='#'>Notification Centre</Link>
                        <Link className='nav_link' to='#'>Profile</Link>
                    </div>
                </div> {/* End of header_wrapper */}
                <div className='header_wrapper'> 
                    <div className='changeable_titles'> 
                        <h1 id='title'>{changeTitle.title}</h1>
                    </div>
                </div>
            </div>
        </div>
    )

}

export default Header
